svg.script:


        var svgDoc = null;
        var svgRoot = null;
        var trueCoords = null; //记录元素在视口中的实际坐标  
        var grabCoords = null; //表示视图经过缩放或移动后的点在视口中的坐标  
        var backDrop = null;
        var GrabPoint = null;
        var DragTarget = null;
        var parentWnd = null; //保存html的window对象
        var selMode = null; //选择信标的模式
        var clientHeight = null; //画布的高
        var clientWidth = null; //画面的宽
        function init(evt) {
            svgDoc = evt.target.ownerDocument;
            svgRoot = evt.target;           
            parentWnd = window.parent;
			clientHeight =parseInt(parentWnd.document.getElementById("txtHeight").value.replace('px', ''));
            clientWidth =parseInt(parentWnd.document.getElementById("txtWidth").value.replace('px', ''));
            selMode = parentWnd.document.getElementById("txtMode") == null ? "" : parentWnd.document.getElementById("txtMode").value;
            //两个不显示的点  
            trueCoords = svgRoot.createSVGPoint();
            GrabPoint = svgRoot.createSVGPoint();
            //定义了画布，作为拖动时间的透明背景层使用，接收所有的触发事件  
            //这样做主要是为了避免因为拖动鼠标速度太快，而离开了被拖拽的元素，导致鼠标的onmousemove事件无法产生  
            //有了这个层，无论被拖拽的元素是否跟得上鼠标的脚步，在这个层都能产生鼠标onmousemove事件  
            backDrop = svgDoc.getElementById("BackDrop");
        }

        //获得当前元素在视口中的坐标位置的函数  
        function GetTrueCoords(evt) {
            var newScale = svgRoot.currentScale; //currentScale获得当前视图的伸缩比例  
            var translation = svgRoot.currentTranslate; //currentTranslate获得当前视图的平移量  
            trueCoords.x = (evt.clientX - translation.x) / newScale;
            trueCoords.y = (evt.clientY - translation.y) / newScale;
        }

       function showArea(evt) {

            if (evt.button != 0) // 只能左键操作
            {
                return;
            }

            var targetElement = evt.target; //取得要拖动的DOM Object  

            if (targetElement.parentNode == null
          || targetElement.parentNode.parentNode == null
          || "UserPositioning" != targetElement.parentNode.parentNode.id) {//判断图形是否是人员定位的区域                 
                return;
            }
            parentWnd.clickObj(targetElement.parentNode.getAttribute("value"));

        }

        //鼠标按下触发的事件  
        function Grab(evt) {

            if (evt.button != 0) // 只能左键操作
            {
                return;
            }

            var targetElement = evt.target; //取得要拖动的DOM Object  
            GetTrueCoords(evt);
            if (targetElement.parentNode == null
          || targetElement.parentNode.parentNode == null
          || "BeaconArea" != targetElement.parentNode.parentNode.id) {//判断图形是否是信标管理的区域  
                DragTarget = null; //后续的拖动事件取消掉  
                return;
            }
            if (backDrop != targetElement) {//不是在拖动背景  
                DragTarget = targetElement;
            }

            if (DragTarget != null && selMode == "") {
                DragTarget.parentNode.appendChild(DragTarget); //把要拖动的元素加入到它的父节点中，类似于在绘图软件中常见的”至于最上方“的操作  

                DragTarget.setAttributeNS(null, "pointer-events", "none"); //取消要拖动元素的鼠标接收事件  
                //这样可以保证当鼠标释放时所触发的事件的”主人“不是要拖动的元素本身，而是它所覆盖的元素，画布或其他元素  

                var Matrix = DragTarget.getCTM(); //获取当前SVG的坐标转换矩阵   
                GrabPoint.x = trueCoords.x - Number(Matrix.e); //定义元素移动后在视图中的坐标  
                GrabPoint.y = trueCoords.y - Number(Matrix.f);
            }

            selectBeacon(targetElement);    // 对选中的信标元素做业务逻辑处理
        }

        //拖动鼠标触发的事件  
        function Drag(evt) {
            if (selMode != "") return;
            GetTrueCoords(evt); //获取当前元素在视口的实际坐标  



            if (DragTarget) { //判断被拖动元素是否存在
                var id = DragTarget.getAttribute("id");
                var text = DragTarget.ownerDocument.getElementById("text_" + id.split('_')[1]);
                if (trueCoords.x < 0 || trueCoords.y < 0 || trueCoords.x > clientWidth || trueCoords.y > clientHeight) {
                    DragTarget.setAttributeNS(null, "transform", "translate(0,0)");
                    if (text != null) text.setAttributeNS(null, "transform", "translate(0,0)");
                }
                else {
                    var newX = trueCoords.x - GrabPoint.x;
                    var newY = trueCoords.y - GrabPoint.y;
                    DragTarget.setAttributeNS(null, "transform", "translate(" + newX + "," + newY + ")"); //设置元素的平移变化参数 实际效果就是被拖动的元素随着鼠标不断移动     
                    DragTarget.setAttributeNS(null, "transform", "translate(" + newX + "," + newY + ")");
                    if (text != null) text.setAttributeNS(null, "transform", "translate(" + (newX) + "," + (newY) + ")");
                }
            }
        }

        //鼠标释放触发的事件
        function Drop(evt) {//evt不是要拖动的元素本身，而是它所覆盖的元素，画布或其他元素  
            if (selMode != "") return;
            if (DragTarget) {
                var targetElement = evt.target;
                DragTarget.setAttributeNS(null, "pointer-events", "all"); //恢复要拖动元素的鼠标接收事件  
                //if ("Box" == targetElement.parentNode.id) {  
                //    targetElement.parentNode.appendChild(DragTarget);  
                //} else {  
                //    alert(DragTarget.id + " 已经位于" + targetElement.id + "之上");  
                //}  

                var newX = trueCoords.x - GrabPoint.x;
                var newY = trueCoords.y - GrabPoint.y;
                if (((newX < 0 || newX > 20) || (newY < 0 && newY > 20)) && trueCoords.x > 0 && trueCoords.y > 0 && trueCoords.x < clientWidth && trueCoords.y < clientHeight) {
                    var id = DragTarget.getAttribute("id");
                    var x = DragTarget.getAttribute("x");
                    var y = DragTarget.getAttribute("y");
                    //alert(id+"；" + x + ">" +(Number(x)+newX)+"；"+ y + ">" + (Number(y)+newY));
                    id = id.split("_")[1];

                    x = Number(x) + newX;
                    y = Number(y) + newY;
                    var result = SaveBeaconPosition(id, x, y);
                    if (result == "ok") // 位置修改成功，则更改信标的x、y
                    {
                        DragTarget.setAttribute("x", x)
                        DragTarget.setAttribute("y", y)
                    }
                    else {
                        alert("移动失败：" + result);
                    }
                    DragTarget.setAttributeNS(null, "transform", "translate(0, 0)");


                    var text = DragTarget.ownerDocument.getElementById("text_" + id);

                    if (text != null) {
                        text.setAttribute("x", parseFloat(x) - 8);
                        text.setAttribute("y", parseFloat(y) + 30);
                        text.setAttributeNS(null, "transform", "translate(0,0)");
                    }

                }

                DragTarget = null;
            }
        }

        function SaveBeaconPosition(id, x, y) {
            if (window.XMLHttpRequest) {
                var oAjax = new XMLHttpRequest();
            }
            else {
                var oAjax = new ActiveXObject("Microsoft.XMLHTTP");
            }
            var url = "../AreaSet/AreaBeaconSet_Ajax.ashx?pType=SetBeaconPositionInfoByMac&mac=" + id + "&x=" + x + "&y=" + y;
            oAjax.open("GET", url, false);
            oAjax.send();

            if (oAjax.readyState == 4) {
                if (oAjax.status == 200) {
                    return oAjax.responseText;
                }
            }

        }

        function selectBeacon(thisObj) {
            //var thisObj = evt.target;
            if (thisObj == null || thisObj == undefined)
                return;
            if (selMode == "single" || selMode == "") {
                if (parentWnd.MacList != null && parentWnd.MacList != undefined && parentWnd.MacList.length > 0) {
                    for (var i = 0; i < parentWnd.MacList.length; i++) {
                        thisObj.ownerDocument.getElementById("Beacon_" + parentWnd.MacList[i]).setAttribute("href", "bluetooth.png");
                    }
                }
                thisObj.setAttribute("href", "bluetooth_sel.png");
                thisObj.ownerDocument.getElementById("txtSelectedIds").setAttribute("value", thisObj.getAttribute("id"));
            } else if (selMode == "Multi") {
                var ids = thisObj.ownerDocument.getElementById("txtSelectedIds").getAttribute("value");
                if (ids.indexOf(thisObj.getAttribute("id")) < 0) {
                    ids += thisObj.getAttribute("id") + '|';
                    thisObj.setAttribute("href", "bluetooth_sel.png");
                }
                else {
                    ids = ids.replace(thisObj.getAttribute("id"), '');
                    thisObj.setAttribute("href", "bluetooth.png");
                }

                thisObj.ownerDocument.getElementById("txtSelectedIds").setAttribute("value", ids);
            }

            thisObj.ownerDocument.getElementById("txtSelectedId").setAttribute("value", thisObj.getAttribute("id"));
        }
